const Cv = ({tasks,seconds,thirds}) => {


  return (
    <>
    <div className='cv' >
        <div className='text' >
            {tasks.text}
            </div>
            <div className='tel'>
            {tasks.tel} | {tasks.email} 
            </div>
            <img src={tasks.image}/>


        <div style={{display:'flex',alignItems:'center',gap:'15px'}}
        key={seconds.count}>
              <div className='name'>
            {seconds.school}
            </div>
            <div className='name'>
            {seconds.title}
            </div>
            <div className='name'>
            {seconds.date}
            </div>
            <div className='name'>
            {seconds.finish}
            </div>
      </div>

      <div style={{display:'flex',alignItems:'center',gap:'15px'}}>
              <div className='name'>
            {thirds.name}
            </div>
            <div className='name'>
            {thirds.position}
            </div>
            <div className='name'>
            {thirds.job}
            </div>
            <div className='name'>
            {thirds.from}
            </div>
            <div className='name'>
            {thirds.to}
            </div>
      </div>


    </div>


    </>
  );
};

export default Cv;
